import React from 'react';
import NewGameButton from './NewGameButton'
import Game from './Game'

class App extends React.Component {
  render(){
    return (
      <div>
        <h1>Lutrivia</h1>
        <NewGameButton />
        <Game questions={this.state.questions.slice(0, 3)}/>
      </div>
    );
  }
}

export default App;
